            title: "El Banquete y el Canto de Iopas",
            content: "Una vez que la comida ha terminado y las mesas son retiradas, se encienden las lámparas y comienza la verdadera velada. Dido pide una gran copa de oro, una reliquia de sus antepasados, y realiza una libación a Júpiter, patrón de la hospitalidad, y a otros dioses, pidiendo una unión feliz entre tirios y troyanos. Tras el brindis, el bardo Iopas, discípulo del titán Atlas, canta un poema épico sobre la creación del universo: el sol errante y los eclipses de luna, el origen de los seres vivos, las estrellas y las constelaciones, y las causas de los solsticios y equinoccios. Mientras los invitados aplauden, la infeliz Dido, ya enamorada, prolonga la noche pidiéndole a Eneas que le cuente en detalle las desgracias de Troya y sus propias andanzas, preparando así el inicio del Libro II."
